import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse(`{"title":"§ 55.1-206 How infant spouse may release interests in spouse's property.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-206.md","filePath":"vacode/55.1-206.md"}`),s={name:"vacode/55.1-206.md"},o=a('<h1 id="§-55-1-206-how-infant-spouse-may-release-interests-in-spouse-s-property" tabindex="-1">§ 55.1-206 How infant spouse may release interests in spouse&#39;s property. <a class="header-anchor" href="#§-55-1-206-how-infant-spouse-may-release-interests-in-spouse-s-property" aria-label="Permalink to &quot;§ 55.1-206 How infant spouse may release interests in spouse&#39;s property.&quot;">​</a></h1><p>Notwithstanding the disability of infancy, on or after January 1, 1991, an infant spouse, whether married before or after January 1, 1991, may release his marital rights in the other spouse&#39;s real or personal property by uniting in any contract, deed, or other instrument executed by the other spouse or by a commissioner of a court pursuant to an order entered under §§ <a href="/vacode/8.01-67/">8.01-67</a> through <a href="/vacode/8.01-77/">8.01-77</a> or any other law with respect to the infant&#39;s property.</p><p>1992, cc. 617, 647, § 55-42.1; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),n=[o];function i(p,c,h,u,d,_){return t(),r("div",null,n)}const y=e(s,[["render",i]]);export{f as __pageData,y as default};
